import React, {useState} from 'react'

function Navbar() {
    const nav = [
        {
            "title":"Syndico",
            "link":""
        },
        {
            "title":"Module",
            "link":""
        },
        {
            "title":"Contact",
            "link":""
        },
    ]
    const langs = [
        {
            "title":"Francais",
            "sub":"Fr",
            "flag":"/images/fr.webp",
            "link":""
        },
        {
            "title":"Arabe",
            "sub":"Ar",
            "flag":"/images/ma.webp",
            "link":""
        },
        {
            "title":"English",
            "sub":"En",
            "flag":"/images/us.webp",
            "link":""
        },
    ]

    const [lang, setLang] = useState(false)

  return (
    <div>
        <div className='navbar'>
            <logo>
                <img src="/images/syndico.png" />
            </logo>
            <ul>
                {nav.map((item,key)=>(
                    <li key={key+1}> <h3> {item.title} </h3> </li>
                ))}
                <li> <i class="fa-solid fa-globe"></i> </li>
            </ul>
        </div>

        lang?<div className='langs'>
            <ul>
            {langs.map((lang,key)=>(
                <li> <img src={lang.flag} /> <h4> {lang.sub} </h4> </li>
            ))}
            </ul>
        </div> : ""
    </div>
  )
}

export default Navbar
